import FarmerRoute from "./auth/FarmerRoute";
import Dashboard from "./user/UserDashboard";
import FarmerDashboard from "./user/FarmerDashboard";
import AddVegetable from "./farmer/AddVegetable";
import Shop from "./core/Shop"

